<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title>Cocos Creator | StickCraft</title>
    <meta name="viewport" content="width=device-width,user-scalable=no,initial-scale=1,minimum-scale=1,maximum-scale=1,minimal-ui=true"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <meta name="full-screen" content="yes"/>
    <meta name="screen-orientation" content="portrait"/>
    <meta name="x5-fullscreen" content="true"/>
    <meta name="360-fullscreen" content="true"/>
    <meta name="renderer" content="webkit"/>
    <meta name="force-rendering" content="webkit"/>
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1"/>
  <style>
body{cursor:default;padding:0;border:0;margin:0;text-align:center;background-color:#fff;font-family:Helvetica,Verdana,Arial,sans-serif}body,canvas,div{outline:0;-moz-user-select:none;-webkit-user-select:none;-ms-user-select:none;-khtml-user-select:none;-webkit-tap-highlight-color:transparent}input::-webkit-inner-spin-button,input::-webkit-outer-spin-button{-webkit-appearance:none;margin:0}#Cocos2dGameContainer{position:absolute;margin:0;overflow:hidden;left:0;top:0}canvas{background-color:rgba(0,0,0,0)}a:link,a:visited{color:#000}a:active,a:hover{color:#666}p.header{font-size:small}p.footer{font-size:x-small}.progress-bar{background-color:#1a1a1a;position:absolute;left:10%;top:80%;height:14px;padding:5px;width:80%;border-radius:5px;box-shadow:0 1px 5px #000 inset,0 1px 0 #444}.progress-bar span{display:block;height:100%;border-radius:3px;box-shadow:0 1px 0 rgba(255,255,255,.5) inset;transition:width .4s ease-in-out;background-color:#34c2e3}.stripes span{background-size:30px 30px;background-image:linear-gradient(135deg,rgba(255,255,255,.15) 25%,transparent 25%,transparent 50%,rgba(255,255,255,.15) 50%,rgba(255,255,255,.15) 75%,transparent 75%,transparent);animation:animate-stripes 1s linear infinite}@keyframes animate-stripes{0%{background-position:0 0}100%{background-position:60px 0}}h1{color:#444;text-shadow:3px 3px 15px}#GameDiv{margin:0 auto;background:#000;position:relative;border:5px solid #000;border-radius:10px;box-shadow:0 5px 50px #333}#Cocos3dGameContainer,#GameCanvas{width:100%;height:100%}</style>

    // if (sys.os == sys.OS.IOS || sys.os == sys.OS.OSX) {

<script>function injectCustomScript(){
    setTimeout(window.boot, 1)

    window.CustomCreateScript = function(){
        var scriptElement = document.createElement('script')
        scriptElement.removeEventListener = function(){}
        scriptElement.addEventListener = function(eventName, cb){
            this.src = ''
            if(eventName === 'load') setTimeout(() => {cb && cb()}, 10)
        }
        return scriptElement
    }

    var xmlHttp = window.CustomXMLHttpRequest = function(){}
    xmlHttp.prototype.send = function(){}
    xmlHttp.prototype.open = function(method, url){
        const self = this
        this.status = 200
        this.url = url
        this.isloaded = true
        
        const jsonExtension = url.match(/\.(json)(\?[a-z0-9=&.]+)?$/)
        const imageExtension = url.match(/\.(jpe?g|png|svg|bmp|gif)(\?[a-z0-9=&.]+)?$/)
        const audioExtension = url.match(/\.(wav|mp3|ogg)(\?[a-z0-9=&.]+)?$/)

        if(jsonExtension) {
            this.response = atob(window.bundleAsset[url])
        }
        else if(imageExtension){
            this.isloaded = false
            fetch(window.bundleAsset[url]).then(res => res.blob()).then(res => {
                self.response = res
                self.onload && self.onload()
            })
        }
        else if(audioExtension){
            this.response = Uint8Array.from(atob(window.bundleAsset[url]), c => c.charCodeAt(0)).buffer
        }
    }
    xmlHttp.prototype.setRequestHeader = function(){}
    xmlHttp.prototype.send = function(){this.isloaded && this.onload && this.onload()}
};injectCustomScript();</script></body>
